import React from 'react';

const KibanaDashboard = () => {
  return (
    <div style={{ width: '100%', height: '100%' }}>
      <iframe
        src="http://ton-serveur-kibana/app/dashboards#/view/ID_DU_DASHBOARD"
        width="100%"
        height="600"
        frameBorder="0"
      ></iframe>
    </div>
  );
};

export default KibanaDashboard;
